package com.face.math.model;

public class AccuratePoint {
	private double x;
	
	private double y;
	
	public AccuratePoint() {
		// TODO Auto-generated constructor stub
	}
	
	public AccuratePoint(double x,double y) {
		this.x = x;
		this.y = y;
	}

	public double getX() {
		return x;
	}

	public void setX(double x) {
		this.x = x;
	}

	public double getY() {
		return y;
	}

	public void setY(double y) {
		this.y = y;
	}
	
	
}
